y+alltransclusions-example-unique-generator','s:54:\"Gets all transcluded titles, marking the missing ones.\";'),('en','messages:apihelp-query+alltransclusions-example-generator','s:40:\"Gets pages containing the transclusions.\";'),('en','messages:apihelp-query+allusers-description','s:31:\"Enumerate all registered users.\";'),('en','messages:apihelp-query+allusers-param-from','s:40:\"The user name to start enumerating from.\";'),('en','messages:apihelp-query+allusers-param-to','s:37:\"The user name to stop enumerating at.\";'),('en','messages:apihelp-query+allusers-param-prefix','s:48:\"Search for all users that begin with this value.\";'),('en','messages:apihelp-query+allusers-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allusers-param-group','s:39:\"Only include users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-excludegroup','s:34:\"Exclude users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-rights','s:141:\"Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:55:\"Adds the information about a current block on the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-groups','s:110:\"Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:50:\"Lists all the groups the user is automatically in.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-rights','s:31:\"Lists rights that the user has.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:32:\"Adds the edit count of the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-registration','s:75:\"Adds the timestamp of when the user registered if available (may be blank).\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-centralids','s:56:\"Adds the central IDs and attachment status for the user.\";'),('en','messages:apihelp-query+allusers-param-limit','s:36:\"How many total user names to return.\";'),('en','messages:apihelp-query+allusers-param-witheditsonly','s:36:\"Only list users who have made edits.\";'),('en','messages:apihelp-query+allusers-param-activeusers','s:61:\"Only list users active in the last $1 {{PLURAL:$1|day|days}}.\";'),('en','messages:apihelp-query+allusers-param-attachedwiki','s:114:\"With <kbd>$1prop=centralids</kbd>, also indicate whether the user is attached with the wiki identified by this ID.\";'),('en','messages:apihelp-query+allusers-example-Y','s:36:\"List users starting at <kbd>Y</kbd>.\";'),('en','messages:apihelp-query+authmanagerinfo-description','s:61:\"Retrieve information about the current authentication status.\";'),('en','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:115:\"Test whether the user\'s current authentication status is sufficient for the specified security-sensitive operation.\";'),('en','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:99:\"Fetch information about the authentication requests needed for the specified authentication action.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login','s:59:\"Fetch the requests that may be used when beginning a login.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login-merged','s:84:\"Fetch the requests that may be used when beginning a login, with form fields merged.\";'),('en','messages:apihelp-query+authmanagerinfo-example-securitysensitiveoperation','s:68:\"Test whether authentication is sufficient for action <kbd>foo</kbd>.\";'),('en','messages:apihelp-query+backlinks-description','s:43:\"Find all pages that link to the given page.\";'),('en','messages:apihelp-query+backlinks-param-title','s:66:\"Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:67:\"Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:143:\"How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-example-simple','s:35:\"Show links to <kbd>Main page</kbd>.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:60:\"Get information about pages linking to <kbd>Main page</kbd>.\";'),('en','messages:apihelp-query+blocks-description','s:40:\"List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+blocks-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:37:\"List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-users','s:39:\"List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:192:\"Get all blocks applying to this IP address or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:37:\"The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-id','s:25:\"Adds the ID of the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-user','s:38:\"Adds the username of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-userid','s:37:\"Adds the user ID of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-by','s:39:\"Adds the username of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-byid','s:38:\"Adds the user ID of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:47:\"Adds the timestamp of when the block was given.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:45:\"Adds the timestamp of when the block expires.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-reason','s:36:\"Adds the reason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-range','s:53:\"Adds the range of IP addresses affected by the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-flags','s:46:\"Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-param-show','s:133:\"Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-example-simple','s:12:\"List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:57:\"List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+categories-description','s:40:\"List all categories the pages belong to.\";'),('en','messages:apihelp-query+categories-param-prop','s:53:\"Which additional properties to get for each category:\";'),('en','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:96:\"Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:46:\"Adds timestamp of when the category was added.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+categories-param-show','s:33:\"Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+categories-param-categories','s:96:\"Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+categories-example-simple','s:72:\"Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-example-generator','s:81:\"Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-description','s:47:\"Returns information about the given categories.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:74:\"Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categorymembers-description','s:35:\"List all pages in a given category.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:142:\"Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:86:\"Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:71:\"Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:94:\"Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:114:\"Adds the type that the page has been categorised as (<samp>page</samp>, <samp>subcat</samp> or <samp>file</samp>).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:49:\"Adds the timestamp of when the page was included.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:166:\"Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:91:\"Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:20:\"Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:83:\"Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:79:\"Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:121:\"Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:117:\"Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:126:\"Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:192:\"Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:30:\"Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:28:\"Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:50:\"Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:66:\"Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+contributors-description','s:89:\"Get the list of logged-in contributors and the count of anonymous contributors to a page.\";'),('en','messages:apihelp-query+contributors-param-group','s:121:\"Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excludegroup','s:116:\"Exclude users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-rights','s:143:\"Only include users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excluderights','s:138:\"Exclude users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-limit','s:32:\"How many contributors to return.\";'),('en','messages:apihelp-query+contributors-example-simple','s:51:\"Show contributors to the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-description','s:271:\"Get deleted revision information.\n\nMay be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:88:\"The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:85:\"The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:105:\"List the deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:60:\"List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevs-description','s:403:\"List deleted revisions.\n\nOperates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+disabled-description','s:36:\"This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-description','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:35:\"How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('en','messages:apihelp-query+embeddedin-description','s:55:\"Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+embeddedin-param-title','s