orm a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+search-description','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+search-param-search','s:175:\"Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-namespace','s:36:\"Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-what','s:32:\"Which type of search to perform.\";'),('en','messages:apihelp-query+search-param-info','s:25:\"Which metadata to return.\";'),('en','messages:apihelp-query+search-param-prop','s:27:\"Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:61:\"Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:35:\"Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-wordcount','s:32:\"Adds the word count of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:52:\"Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:34:\"Adds a parsed snippet of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:40:\"Adds a parsed snippet of the page title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:44:\"Adds a parsed snippet of the redirect title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:40:\"Adds the title of the matching redirect.\";'),('en','messages:apihelp-query+search-paramvalue-pro