INSERT INTO `text` VALUES (1,'<strong>MediaWiki has been installed.</strong>\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(2,'With 7,500 students and nearly 100,000 living alumni, Rensselaer is addressing the global challenges facing the 21st centuryâ€”to change lives, to advance society, and to change the world.\nFrom renewable energy to cybersecurity, from biotechnology to materials science, from big data to nanotechnology, the world needs problem solversâ€”exactly the kind of talent Rensselaer producesâ€”to address the urgent issues of today and the emerging issues of tomorrow.\nRensselaer faculty include members of the National Academies, 176 Fellows of professional societies, and 63 NSF CAREER Award recipients','utf-8'),(3,'{| class=\"wikitable sortable mw-collapsible\"\n|+ Demo Table\n! style=\"background:#0000ff\" | Header 1\n! style=\"background:#0000ff\" | Header 2\n! style=\"background:#0000ff\" | Header 3\n|- valign=\"top\"\n| cell 1 || cell 1 || dell 3 dell 3 <br> dell 3\n|-\n| dell 1 || cell 2 || cell 3\n|-\n| bell 1 || cell 3 || cell 2\n|}','utf-8'),(4,'With 7,500 students and nearly 100,000 living alumni, Rensselaer is addressing the global challenges facing the 21st centuryâ€”to change lives, to advance society, and to change the world.\nFrom renewable energy to cybersecurity, from biotechnology to 